<!DOCTYPE html>
<html ng-app="dreamster">
<head>
    <meta charset="utf-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <title>DREAMSTER LOGIN</title>
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <link href="https://fonts.googleapis.com/css?family=Roboto:500i" rel="stylesheet" />  
    
    
    <link rel="manifest" href="manifest.json">
    <script src="https://ajax.googleapis.com/ajax/libs/angularjs/1.6.4/angular.min.js"></script>
    <script src="https://ajax.googleapis.com/ajax/libs/angularjs/1.6.4/angular-route.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/jquery/3.3.1/jquery.js"></script>
    <link rel="stylesheet" href="https://fonts.googleapis.com/icon?family=Material+Icons" />
    <link rel="stylesheet" href="https://code.getmdl.io/1.3.0/material.deep_purple-red.min.css" />
    <script defer src="https://code.getmdl.io/1.3.0/material.min.js"></script>
    
    <link rel="stylesheet" type="text/css" href="main.css"/>
    <script src="app.js"></script>
    


</head>

<script>
    $(document).ready(function() {
        if('serviceWorker' in navigator){
            try{
                navigator.serviceWorker.register('sw.js');
                console.log("SW registered");
            }catch(error){
                console.log("SW not registered");
            }
        }
    });
</script> 
<body>

<div id="view_div" ng-view></div>
    
</body>
</html>
